import React, { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { productListDownload } from "../actions/adminActions";

function ProductList(props) {
  const userHistory = useSelector((state) => state.userHistory);
  const { loading, error, histories } = userHistory;

  const dispatch = useDispatch();
  const handleDownload = (e) => {
    e.preventDefault();
    dispatch(productListDownload());
  };

  return (
    <div>
      {loading ? (
        <div>Loading...</div>
      ) : error ? (
        <div>{error}</div>
      ) : (
        <div className="container mt-5 mb-3">
          <div className="row">
            <div className="col-ml-6">
              <h2 className="">Products</h2>
            </div>
            <div className="col-ml-6 ml-auto">
              <button className="btn btn-primary" onClick={handleDownload}>
                Download CSV
              </button>
            </div>
          </div>

          {histories.length > 0 ? (
            <table className="table table-hover table-fixed">
              <thead>
                <tr>
                  <th>#</th>
                  <th>Phone Number</th>
                  <th>Product Name</th>
                  <th>Serial Number</th>
                  <th>Pin Code</th>
                  <th>Point</th>
                </tr>
              </thead>
              <tbody>
                {histories.map((history) => (
                  <tr>
                    <td>1</td>
                    <td>0{history.user.phone}</td>
                    <td>{history.usedSerial_Prouct_Name}</td>
                    <td>{history.usedSerial}</td>
                    <td>{history.code}</td>
                    <td>{history.point}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          ) : (
            <div className="center mt-5">Product Empty</div>
          )}
        </div>
      )}
    </div>
  );
}

export default ProductList;
